enable = effect('Jump - Opacité')('Pseudo/aHCxb79bbc95d-0001');
elastic = $bm_div(effect('Jump - Opacité')('Pseudo/aHCxb79bbc95d-0004'), 100);
gravity = $bm_mul(effect('Jump - Opacité')('Pseudo/aHCxb79bbc95d-0005'), 100);
jumpMax = effect('Jump - Opacité')('Pseudo/aHCxb79bbc95d-0006');
$bm_rt = on_off = effect('Jump - Opacité')('Pseudo/aHCxb79bbc95d-0002');
if (enable == 0) {
    $bm_rt = value;
} else {
    $bm_rt = n = 0;
    if (numKeys > 0) {
        $bm_rt = n = nearestKey(time).index;
        if (key(n).time > time) {
            n--;
        }
    }
    if (n > 0) {
        t = $bm_sub(time, key(n).time);
        v = $bm_mul($bm_neg(velocityAtTime($bm_sub(key(n).time, 0.001))), elastic);
