            delta = $bm_sub(t, tCur);
            $bm_rt = inOutExp = $bm_mul($bm_mul(vu, delta), $bm_sub(vl, $bm_div($bm_mul(gravity, delta), 2)));
            if (on_off == 1) {
                $bm_rt = value = $bm_sub(value, inOutExp);
            } else {
                $bm_rt = value = $bm_sum(value, inOutExp);
            }
        } else {
            $bm_rt = value = value;
        }
    } else {
        $bm_rt = value = value;
    }
}

